<script>
function converHTMLFileToPDF() {
    var element = document.getElementById('pdf');
    var opt = {
        margin: 1,
        filename: 'Bulletin <?=$model->day?>.pdf',
        pagebreak: {
            before: ['.pageBreak']
        },
        image: {
            type: 'jpeg',
            quality: 0.99
        },
        html2canvas: {
            scale: 4,
            useCORS: true
        },
        jsPDF: {
            unit: 'in',
            format: [14.2, 18.4],
            orientation: 'landscape'
        }
    };

    // New Promise-based usage:
    html2pdf().set(opt).from(element).save().then(
        function(pdf) {
            history.back();
            
        }

    );
}

$(function() {
    converHTMLFileToPDF();
});
</script>

